import React, { Component } from 'react'
import Child1 from '../child1/Child1'


export default class Parent extends Component {
  state={
      product: [
        {id:2347, name:'Iphone 14 pro', category:'Mobile Phone', price: 56000, sale: true, stock:32},
        {id:2487, name:'Samsung Galaxy S26 ', category:'Mobile Phone', price: 24500, sale: false, stock:62},
        {id:2634, name:'HP Laserjet p1102', category:'Printers', price: 4300, sale: false, stock:13},
        {id:2893, name:'Samsung G5', category:'Screens', price: 8700, sale: false, stock:320},
        {id:2045, name:'Nikon Z-6II', category:'Camera', price: 62000,sale: true, stock:6},
        {id:4345, name:'Hyper-X Cloud Alpha', category:'Headphones', price: 6450, sale: false, stock:17}
      ]
        
    }
  render() {
   let allProducts = this.state.product.filter((pr)=> {
   return <Child1 inncomingProduct={pr} /> 
  }).map((pr)=>{
   return !pr.sale?<Child1 key={pr.id} inncomingProduct={pr} />:''
  })
    
    return (
      <>
        <div className='row m-3 bg-secondary'>
          {allProducts}
        </div>
      </>
    )
  }
}
